### Describe the issue

I'm trying to run the model in Vue using onnxruntime-web@1.15.1, I have no problem running the project directly in the compiler, but when I package the project and put it into nginx for publishing, running the model 'this.model.run(feeds)' gives me the error RuntimeError: memory access out of bounds error. I've tried a lot of ways on the internet but I can't solve it, I don't know if it's a problem with onnxruntime-web, because each version reports the error in a different location.

