### Describe the issue

Loading an model with `Inference.create` does not work when running on real iOS devices.

It fails with the error: "Can't load a model: failed to load model from buffer"

The same code works on Android emulator, real Android device, and iOS emulator. It only fails on a real iPhone. Tested with iPhone 12,13,14

